%spark 
// You have to add highcharts.js to the bower.json and index.html. You can check the following repo for more details.
// https://github.com/tromika/incubator-zeppelin/tree/customjs2
val df = z.get("myDataFrame")
z.angularBind("data", df)
println("""
%angular
<script>
var paragraph = $("#p""" + z.getInterpreterContext().getParagraphId() + """_angular");
paragraph.scope().compiledScope.MyCtrl = function($scope) {
    var array = [];
    for (var prop in $scope.data)
        array.push([prop, $scope.data[prop]]);
    $('#container').highcharts({
        chart: {
            type: 'bar'
        },
        title: {
            text: 'Flight delay casuses in the US between Jan - Aug/2016',
            x: -20 
        },
        xAxis: {
             type: "category",
            title: {
                text: 'Type of delay'
            }
        },
        yAxis: {
            title: {
                text: 'Nb of delays'
            }
        },
        legend: {
            enabled: false
        },
        series: [{
            data:array,
            color: '#8fc800',
        }]
    });
};
</script>
<div id="container" ng-controller="MyCtrl as ctrl">
</div>
""")
